            emit OrderCanceled(newOrder.id, msg.sender, OrderType.Sell);
        } else {
            newOrder.isFulfilled = true;
            sellOrders[inputToken][outputToken].push(newOrder);
            emit OrderCreated(
                newOrder.id,
                msg.sender,
                OrderType.Sell,
                inputToken,
                inputAmount,
                outputToken,
                totalOutputMatched
            );
        }

        return newOrder;
    }



